import Vue from 'vue'
export default Vue.extend({
  name: 'AppHeader',
  props: {
    onChangeLanguage: {
      type: Function,
      required: true
    },
    language: {
      type: String,
      default: null
    }
  },
  data: () => ({
    defaultLanguage: 'en'
  }),
  watch: {
    language() {
      this.defaultLanguage = this.language
    }
  },
  methods: {
    changeLanguage(languageSelected: string) {
      this.$emit('on-change-language', languageSelected)
    }
  }
})
